'use strict';
let BaseEvent = require('./BaseEvent.js');
//@@DocInclude
//@@DocBrief("This class creates objects that can be used to trigger actions or display information in response to certain events")
class InfoEvent extends BaseEvent {
    message;
    constructor() {
        super();
        this.message = "";
    }
    getMessage() {
        return this.message;
    }
}
module.exports = InfoEvent
